    public int bestSeqAtIndex(int[] height, int[] weight) {

        if (height == null || weight == null || weight.length != height.length) {
            return 0;
        }
        int n = height.length;
        int[][] pairs = new int[n][2];
        for (int i = 0; i < n; i++) {
            pairs[i] = new int[]{height[i], weight[i]};
        }

        Arrays.sort(pairs, (a, b) -> {
            if (a[0] == b[0]) {
                return b[1] - a[1];
            }
            return a[0] - b[0];
        });

        List<int[]> pokeList = new ArrayList<>();
        pokeList.add(pairs[0]);
        int l = 0;
        int r = 0;
        int m = 0;
        for (int i = 1; i < n; i++) {// 遍历 pair数组
//            System.out.print(" i ：");
//            Printer.print(pairs[i]);
//            System.out.println(" ---------- ");
            int[] last = pokeList.get(pokeList.size() - 1);

//            pokeList.forEach(a -> Printer.print(a));
//            System.out.println("--");

            if (last[1] < pairs[i][1]) {
                pokeList.add(pairs[i]);
            } else if (last[1] > pairs[i][1]) {
                l = 0;
                r = pokeList.size() - 1;
                // 找到第一个大于 pair[i][1]的位置
                while (l + 1 < r) {
                    m = (r - l) / 2 + l;
                    if (pokeList.get(m)[1] < pairs[i][1]) {
                        l = m;
                    } else {
                        r = m;
                    }
                }
                if (pokeList.get(l)[1] > pairs[i][1])
                    pokeList.get(l)[1] = pairs[i][1];
                else
                    pokeList.get(r)[1] = pairs[i][1];
            }
//            pokeList.forEach(a -> Printer.print(a));
//            System.out.println(" =========== ");

        }

        return pokeList.size();
    }

    public int bestSeqAtIndex_ii(int[] height, int[] weight) {
        if (height == null || weight == null || weight.length != height.length) {
            return 0;
        }
        int n = height.length;
        int[][] pairs = new int[n][2];
        for (int i = 0; i < n; i++) {
            pairs[i] = new int[]{height[i], weight[i]};
        }

        Arrays.sort(pairs, (a, b) -> {
            if (a[0] == b[0]) {
                return a[1] - b[1];
            }
            return a[0] - b[0];
        });
        /*
         表示前i个人能够叠成的最多人数
         dp[i] = max(dp[j] + 1) | j in 0 ~ i - 1 && num[i] >= num[j], 
        */

        int[] dp = new int[n + 1];
        dp[1] = 1;
        int ans = 0;
        for (int i = 2; i <= n; i++) {
            dp[i] = 1;
            for (int j = 0; j < i; j++) {
                if (j - 1 >= 0 && pairs[i - 1][0] > pairs[j - 1][0]
                        && pairs[i - 1][1] > pairs[j - 1][1]) {
                    dp[i] = Math.max(dp[j] + 1, dp[i]);
                }
            }
            ans = Math.max(dp[i], ans);
        }
        return ans;
    }
